class Solution:
    def maxOperations(self, s: str) -> int:
        ans=0
        one=0
        i=0
        while i<len(s):
            if s[i]=='1':
                j=i
                while j+1<len(s) and s[j+1]=='0':
                    j+=1
                one+=1
                if i!=j: ans+=one
                i=j
            i+=1
        return ans
